import React, { FunctionComponent } from "react";
import { Button } from "react-bootstrap";
import { useSelector } from "react-redux";
import { resourceEndPoint } from "../../API/apiEndpoint";
import './MessageRequest.css'

interface FriendRequestProps {
    ProfilePic:string,
    Name:string
}

const FriendRequest: FunctionComponent<FriendRequestProps> = ({ProfilePic,Name}) => {
    const userData = useSelector((state: any) => state.auth.userData);
    return ( <div className="request-container">
        <div className="request-container__initails">
        <div className="request-container__img"><img src={resourceEndPoint + `/${ProfilePic}`}></img></div>
        <div className="request-container__Name"><p>{Name}</p></div>
        </div>
        <div className="request-container__action">
            <div className="request-container__actionElement">
            <Button variant="primary">Accept</Button>{' '}
            </div>
            <div className="request-container__actionElement">
            <Button variant="outline-primary">Reject</Button>{' '}
            </div>
        </div>
    </div> );
}

export default FriendRequest;
